import React from 'react'
import { useGetDevicesQuery } from '../../redux/api/server.api'
import './Devices.scss'
export default function Devices() {

   const {data:Devices,isLoading} = useGetDevicesQuery('') 
   if(isLoading){
    return <h1>Идет загрузка</h1>
   } 
  return (
    <div className='devices'>
      {Devices?.rows.map((el)=>
      <ul>
      <li>{el.name}</li>
      </ul>
      )}
    </div>
  )
}
